class TrivialObjectnessGenerator:

    def __init__(self, DSL, validation=False):
        self.DSL = DSL
        self.validation = validation
        self.NEW_LEVEL = 0
        self.IDENTITY = 1
        
    @staticmethod
    def paste_objects_on_grid(target_grid, list_of_objs, last_prim, adjacency_ok=True):
        height, width = len(target_grid), len(target_grid[0])

        overall_attempts = 0
        while True:
            overall_attempts += 1

            if overall_attempts == 50:
                return None
            
            # Reset the result grid
            result_grid = [[target_grid[i][j] for j in range(width)] for i in range(height)]
            memory_grid = [[-1 for j in range(width)] for i in range(height)]

            # If compress_objects_quad, try to place objects in a square-ish arrangement
            if last_prim in ['compress_objects_quad', 'compress_objects_quad_pad']:
                num_objs = len(list_of_objs)
                grid_size = int(np.ceil(np.sqrt(num_objs)))  # Size of square grid to place objects
                
                # Calculate spacing between objects
                h_spacing = width // (grid_size + 1)
                v_spacing = height // (grid_size + 1)
                
                placed_objs = 0
                for row in range(grid_size):
                    if placed_objs >= num_objs:
                        break
                    for col in range(grid_size):
                        if placed_objs >= num_objs:
                            break
                            
                        obj = list_of_objs[placed_objs]
                        obj_h, obj_w = len(obj), len(obj[0])
                        
                        # Calculate position with some random offset
                        pos_y = (row + 1) * v_spacing + random.randint(-v_spacing//4, v_spacing//4)
                        pos_x = (col + 1) * h_spacing + random.randint(-h_spacing//4, h_spacing//4)
                        
                        # Ensure object fits within bounds
                        pos_y = max(0, min(pos_y, height - obj_h))
                        pos_x = max(0, min(pos_x, width - obj_w))
                        
                        # Check if position is clear, allowing for adjacency_ok
                        can_place = True
                        if adjacency_ok:
                            for i in range(obj_h):
                                for j in range(obj_w):
                                    if memory_grid[pos_y + i][pos_x + j] != -1:
                                        can_place = False
                                        break
                                if not can_place:
                                    break
                        else:
                            start_x = max(0, pos_x - 1)
                            start_y = max(0, pos_y - 1)
                            end_x = min(pos_x + obj_w + 2, width)
                            end_y = min(pos_y + obj_h + 2, height)
                            for i in range(start_y, end_y):
                                for j in range(start_x, end_x):
                                    if memory_grid[i][j] != -1:
                                        can_place = False
                                        break
                                if not can_place:
                                    break

                        if can_place:
                            # Place the object
                            for i in range(obj_h):
                                for j in range(obj_w):
                                    memory_grid[pos_y + i][pos_x + j] = obj[i][j]
                                    result_grid[pos_y + i][pos_x + j] = obj[i][j]

                            placed_objs += 1
                        
                if placed_objs == len(list_of_objs):
                    return result_grid
                else:
                    continue
                    
            # For other primitives, place randomly
            random.shuffle(list_of_objs)
            placed_all = True
            
            for obj in list_of_objs:
                obj_h = len(obj)
                obj_w = len(obj[0])
                
                # Try to place the object 50 times
                placed = False
                for _ in range(50):
                    # Pick a random position
                    pos_y = random.randint(0, height - obj_h)
                    pos_x = random.randint(0, width - obj_w)
                    
                    # Check if position is clear
                    can_place = True
                    if adjacency_ok:
                        for i in range(obj_h):
                            for j in range(obj_w):
                                if memory_grid[pos_y + i][pos_x + j] != -1:
                                    can_place = False
                                    break
                            if not can_place:
                                break
                    else:
                        start_x = max(0, pos_x - 1)
                        start_y = max(0, pos_y - 1)
                        end_x = min(pos_x + obj_w + 2, width)
                        end_y = min(pos_y + obj_h + 2, height)
                        for i in range(start_y, end_y):
                            for j in range(start_x, end_x):
                                if memory_grid[i][j] != -1:
                                    can_place = False
                                    break

                            if not can_place:
                                break
                           
                    if can_place:
                        # Place the object
                        for i in range(obj_h):
                            for j in range(obj_w):
                                result_grid[pos_y + i][pos_x + j] = obj[i][j]
                                memory_grid[pos_y + i][pos_x + j] = obj[i][j]
                        placed = True
                        break
                        
                if not placed:
                    placed_all = False
                    break
                    
            if placed_all:
                return result_grid

