    @staticmethod
    def generate_object_grid(num_objects, with_padding, last_prim):
        # Determine target grid dimensions
        if num_objects == 1:
            width = np.random.randint(3, 31)
            height = np.random.randint(3, 31)
        elif num_objects == 2:
            width = np.random.randint(6, 31)
            height = np.random.randint(6, 31)
            if width < 6 and height < 6:
                if np.random.choice([True, False]):
                    width = 6
                else:
                    height = 6
        else:
            min_dim = num_objects * 3
            width = np.random.randint(min_dim, 31)
            height = np.random.randint(min_dim, 31)

        # Select sub-grid dimension
        sub_grid_dim = np.random.randint(3, min(7, min(width, height) + 1))

        # Calculate number of sub-grids in each dimension
        # If padding is enabled, account for black spacing between sub-grids
        step = sub_grid_dim + 1 if with_padding else sub_grid_dim
        num_x_subgrids = width // step 
        num_y_subgrids = height // step

        # Initialize target grid with background color 0
        bg_color = np.random.choice(np.arange(10))
        target_grid = [[bg_color for _ in range(width)] for _ in range(height)]

        # Generate random positions for objects
        # print("==> num_x_subgrids = %i, num_y_subgrids = %i, num_objects = %i, width = %i, height = %i" % (
        #     num_x_subgrids,
        #     num_y_subgrids,
        #     num_objects,
        #     width,
        #     height
        # ))
        positions = np.random.choice(num_x_subgrids * num_y_subgrids, num_objects, replace=False)

        # Fill sub-grids with colored squares
        for i, pos in enumerate(positions):
            x_subgrid = pos % num_x_subgrids
            y_subgrid = pos // num_x_subgrids
            
            # Calculate start position accounting for padding if enabled
            start_x = x_subgrid * step
            start_y = y_subgrid * step
            
            if np.random.choice([True, False]):
                # Fill the sub-grid with a single color
                color = np.random.choice([c for c in range(1, 10) if c != bg_color])
                for y in range(sub_grid_dim):
                    for x in range(sub_grid_dim):
                        if start_y + y < height and start_x + x < width:
                            target_grid[start_y + y][start_x + x] = color
            else:
                # Fill the sub-grid with multiple colors
                num_colors = np.random.randint(2, 5)  # 2 to 4 colors
                colors = np.random.choice([c for c in range(1, 10) if c != bg_color], size=num_colors)
                for y in range(sub_grid_dim):
                    for x in range(sub_grid_dim):
                        if start_y + y < height and start_x + x < width:
                            target_grid[start_y + y][start_x + x] = np.random.choice(colors)

        return tuple(tuple(row) for row in target_grid)

