    @staticmethod
    def augment_grid(grid, hp):
        num_rotations = np.random.choice(np.arange(4))
        for _ in range(num_rotations):
            grid = hp.rot90(grid)

        transform = np.random.choice(['vmirror', 'hmirror', 'invert_colors', 'color_change'])
        a = np.random.uniform()
        if a < 0.75:
            if transform == 'vmirror':
                grid = hp.vmirror(grid)
            elif transform == 'hmirror':
                grid = hp.hmirror(grid)
            elif transform == 'invert_colors':
                grid = hp.invert_colors(grid)
            elif transform == 'color_change':
                colors_in_grid = set(cell for row in grid.cells for cell in row)
                if colors_in_grid:
                    c1 = np.random.choice(list(colors_in_grid))  # Randomly select a color from the grid
                    c2 = np.random.choice(np.arange(1, 10))

                    grid = hp.color_change(grid, c1, c2)

        possible_shifts = []

        # Check left column
        if all(grid.cells[i][0] == 0 for i in range(len(grid.cells))):
            possible_shifts.append('shift_left')
        
        # Check right column
        if all(grid.cells[i][-1] == 0 for i in range(len(grid.cells))):
            possible_shifts.append('shift_right')
        
        # Check top row
        if all(grid.cells[0][j] == 0 for j in range(len(grid.cells[0]))):
            possible_shifts.append('shift_up')
        
        # Check bottom row
        if all(grid.cells[-1][j] == 0 for j in range(len(grid.cells[0]))):
            possible_shifts.append('shift_down')

        b = np.random.uniform()
        if b < 0.5 and len(possible_shifts) > 0:
            apply_shift = np.random.choice(possible_shifts)
            if apply_shift == 'shift_left':
                grid = hp.shift_left(grid)
            if apply_shift == 'shift_right':
                grid = hp.shift_right(grid)
            if apply_shift == 'shift_up':
                grid = hp.shift_up(grid)
            if apply_shift == 'shift_down':
                grid = hp.shift_down(grid)

        return grid

    def generate_input_grids(self, num_objects, get_objects, all_same_shape, last_prim, k, hp):
        input_grids = []
        with_padding = False
        if get_objects == 'get_objects6':
            with_padding = np.random.choice([True, False])

        for _ in range(k):
            a = np.random.uniform()
            if a < 0.1 and last_prim != 'cellwiseOR_list':
                # Use pre-determined grids from training or validation
                input_grid = self.select_grid(num_objects, get_objects, all_same_shape)

                if input_grid is None:
                    # Randomly generate grids
                    input_grid = self.generate_random_grid(num_objects, get_objects, all_same_shape, last_prim, hp, with_padding)
                else:
                    input_grid = TrivialObjectnessGenerator.augment_grid(input_grid, hp)
            else:
                # Randomly generate grids
                input_grid = self.generate_random_grid(num_objects, get_objects, all_same_shape, last_prim, hp, with_padding)

            input_grids.append(input_grid)

        return input_grids

    def verify_obj_transforms(self, get_objects, transform, input_grids, c1, c2, task_desc):
        get_objects_func = self.DSL.semantics[get_objects]
        transform_func = self.DSL.semantics[transform]

        example_valid_list = []
        for example_idx in range(len(input_grids)):
            example_valid = False

            grid_inp = input_grids[example_idx]

            obj_list = get_objects_func(grid_inp)

            transformed_obj_list = []
            for obj in obj_list:
                if 'color_change' not in task_desc:
                    transformed = transform_func(obj)
                else:                        
                    transformed = transform_func(obj)(c1)(c2)

                transformed_obj_list.append(transformed)

            # Check if all objects are exactly the same
            for obj_idx in range(len(obj_list)):
                orig_obj = obj_list[obj_idx]
                trans_obj = transformed_obj_list[obj_idx]

                if len(orig_obj.cells) != len(trans_obj.cells):
                    example_valid = True
                    break

                if len(orig_obj.cells[0]) != len(trans_obj.cells[0]):
                    example_valid = True
                    break

                if not np.array_equal(orig_obj.cells, trans_obj.cells):
                    example_valid = True
                    break

            example_valid_list.append(example_valid)

        return example_valid_list

    def generate(self, hp, k=6):

        a = np.random.uniform()

        if a < 0.1:
            apply_transforms = False
        else:
            apply_transforms = True

        task_invalid = True
        while task_invalid:
            try:
                # 1) Decide how many objects to use in this task
                num_objects = np.random.choice(np.arange(1, 10), p=[0.2, 0.2, 0.2, 0.2, 0.025, 0.05, 0.025, 0.025, 0.075])

                # 2) Pick a get_objects primitive
                get_objects = np.random.choice(['get_objects1', 'get_objects2', 'get_objects3', 'get_objects4', 'get_objects5', 'get_objects6'])

                # 3) Decide if objects will be multicolor. If they are, add color_change and invert_colors to the primitives.
                possible_transforms = ['rot90', 'rot180', 'rot270', 'hmirror', 'vmirror', 'tophalf', 'bottomhalf', 'lefthalf', 'righthalf', 'first_quadrant', 'second_quadrant', 'third_quadrant', 'fourth_quadrant', 'remove_outline', 'get_major_pixel',
                                       'set_fg_color1','set_fg_color2','set_fg_color3','set_fg_color4','set_fg_color5','set_fg_color6','set_fg_color7','set_fg_color8','set_fg_color9']

                if get_objects in ['get_objects1', 'get_objects2', 'get_objects3']:
                    is_multicolor = False
                else:
                    is_multicolor = True

                if is_multicolor:
                    possible_transforms.append('color_change')
                    possible_transforms.append('invert_colors')

                # 4) Pick the transform to apply to the objects
                transform = np.random.choice(possible_transforms)

                # 5) Decide if all objects will be of the same dimension (if so, we can do compress_object_*)
                all_same_shape = np.random.choice([True, False])

                # If we choose not to do an apply_to_grid task, then necessarily the objects must all be of the
                # same shape in order to be able to to compress_objects_* or cellwiseOR_list
                if not apply_transforms:
                    all_same_shape = True

                if transform == 'get_major_pixel' and apply_transforms:
                    all_same_shape = False      # get_major_pixel makes the "same shape" requirement unnecessary

                # 6) Pick final primitive and generate program string.
                if num_objects == 1:
                    last_prim = np.random.choice(['None', 'apply_to_grid'])

                    if apply_transforms:
                        if last_prim == 'None':
                            program = [get_objects, transform, 'NEW_LEVEL', 'for_each']
                        else:
                            if last_prim == 'apply_to_grid':
                                possible_transforms.extend(['shear_grid_left', 'shear_grid_right', 'shear_grid_zigzag'])
                                transform = np.random.choice(possible_transforms)
                            program = [get_objects, transform, 'NEW_LEVEL', 'for_each', 'NEW_LEVEL', last_prim]
                    else:
                        program = [get_objects]
                elif num_objects in [2, 3]:
                    if all_same_shape:
                        last_prim = np.random.choice(['apply_to_grid', 'compress_objects_linear'])
                    else:
                        last_prim = 'apply_to_grid'

                    if apply_transforms:
                        if last_prim == 'apply_to_grid':
                            possible_transforms.extend(['shear_grid_left', 'shear_grid_right', 'shear_grid_zigzag'])
                            transform = np.random.choice(possible_transforms)

                        program = [get_objects, transform, 'NEW_LEVEL', 'for_each', 'NEW_LEVEL', last_prim]
                    else:
                        # Here we have forced all_same_shape == True anyway.
                        if get_objects in ['get_objects5', 'get_objects4']:
                            last_prim = np.random.choice(['compress_objects_linear', 'cellwiseOR_list'])
                        else:
                            last_prim = 'compress_objects_linear'

                        program = [get_objects, 'NEW_LEVEL', last_prim]
                elif num_objects == 4:
                    if apply_transforms:
                        if all_same_shape:
                            last_prim = np.random.choice(['apply_to_grid', 'compress_objects_linear', 'compress_objects_quad', 'compress_objects_quad_pad'])
                        else:
                            last_prim = 'apply_to_grid'

                        if last_prim == 'apply_to_grid':
                            possible_transforms.extend(['shear_grid_left', 'shear_grid_right', 'shear_grid_zigzag'])
                            transform = np.random.choice(possible_transforms)

                        program = [get_objects, transform, 'NEW_LEVEL', 'for_each', 'NEW_LEVEL', last_prim]
                    else:
                        # Here we have forced all_same_shape == True anyway.
                        if get_objects in ['get_objects5', 'get_objects4']:
                            last_prim = np.random.choice(['compress_objects_linear', 'compress_objects_quad', 'compress_objects_quad_pad', 'cellwiseOR_list'])
                        else:
                            last_prim = np.random.choice(['compress_objects_linear', 'compress_objects_quad', 'compress_objects_quad_pad'])

                        program = [get_objects, 'NEW_LEVEL', last_prim]
                elif num_objects in [6, 9]:
                    if apply_transforms:
                        if all_same_shape:
                            last_prim = np.random.choice(['apply_to_grid', 'compress_objects_quad', 'compress_objects_quad_pad'])
                        else:
                            last_prim = 'apply_to_grid'

                        if last_prim == 'apply_to_grid':
                            possible_transforms.extend(['shear_grid_left', 'shear_grid_right', 'shear_grid_zigzag'])
                            transform = np.random.choice(possible_transforms)

                        program = [get_objects, transform, 'NEW_LEVEL', 'for_each', 'NEW_LEVEL', last_prim]
                    else:
                        # Here we have forced all_same_shape == True anyway.
                        last_prim = np.random.choice(['compress_objects_quad', 'compress_objects_quad_pad'])
                        program = [get_objects, 'NEW_LEVEL', last_prim]
                else:
                    last_prim = 'apply_to_grid'

                    possible_transforms.extend(['shear_grid_left', 'shear_grid_right', 'shear_grid_zigzag'])
                    transform = np.random.choice(possible_transforms)

                    program = [get_objects, transform, 'NEW_LEVEL', 'for_each', 'NEW_LEVEL', last_prim]

                # 7) Generate input grids based on (num_objects, get_objects).
                input_grids = self.generate_input_grids(num_objects, get_objects, all_same_shape, last_prim, k, hp)

                # 8) potentially apply a last global grid transform
                a = np.random.uniform()
                final_transform = None
                if a < 0.2:
                    final_transform = np.random.choice(['remove_outline', 'insert_outline', 'set_fg_color1', 'set_fg_color2', 'set_fg_color3', 'set_fg_color4', 'set_fg_color5', 'set_fg_color6', 'set_fg_color7', 'set_fg_color8', 'set_fg_color9'])

                if final_transform is None:
                    program.append('EOS')
                else:
                    program.append(final_transform)
                    program.append('EOS')

                NUM_SPECIAL_TOKENS = 4
                def convert_to_label_seq(program):
                    label_seq = []
                    for token in program:
                        if token == 'NEW_LEVEL':
                            token_idx = 1
                        elif token == 'IDENTITY':
                            token_idx = 2
                        elif token == 'EOS':
                            token_idx = 3
                        else:
                            token_idx = hp.prim_indices[token] + NUM_SPECIAL_TOKENS

                        label_seq.append(token_idx)

                    return label_seq

                # 9) compile the program string and generate the output grids from the inputs
                label_seq = convert_to_label_seq(program)

                # run the program interpreter on the task
                program_tree = pi.generate_syntax_trees(np.array(label_seq), hp)
                task_desc = pi.write_program(program_tree, np.array(label_seq), hp)
            
                print("==> Trivial objectness generator, generating task program:")
                print(task_desc)

                c1 = None
                c2 = None
                if 'color_change' in task_desc:
                    # Find colors present in all input grids
                    colors_in_first = set(cell for row in input_grids[0].cells for cell in row)
                    common_colors = colors_in_first.copy()
                    for grid in input_grids[1:]:
                        grid_colors = set(cell for row in grid.cells for cell in row)
                        common_colors.intersection_update(grid_colors)
                    
                    if not common_colors:
                        # Find most frequent color across all grids
                        color_counts = {}
                        for grid in input_grids:
                            grid_colors = set(cell for row in grid.cells for cell in row)
                            for color in grid_colors:
                                color_counts[color] = color_counts.get(color, 0) + 1
                        c1 = max(color_counts.items(), key=lambda x: x[1])[0]
                    else:
                        c1 = np.random.choice(list(common_colors))
                        
                    # Pick random c2 different from c1
                    c2 = random.randint(1, 9)
                    while c1 == c2:
                        c2 = random.randint(1, 9)

                # 10) verify that this program results in at least one non-identity transformation on objects
                list_valid_examples = []
                if apply_transforms:
                    list_valid_examples = self.verify_obj_transforms(get_objects, transform, input_grids, c1, c2, task_desc)
                else:
                    for _ in range(len(input_grids)):
                        list_valid_examples.append(True)

                program_func = pi.compile_program(task_desc, hp.semantics)

                example_grid_set = []
                for example_idx in range(len(input_grids)):

                    if not list_valid_examples[example_idx]:
                        continue

                    grid_inp = input_grids[example_idx]

                    # print("==> Processing input grid:")
                    # viz.draw_single_grid(grid_inp.cells)

                    if 'color_change' not in task_desc:
                        pred_output = program_func(grid_inp)
                    else:                        
                        pred_output = program_func(grid_inp, c1, c2)

                    if isinstance(pred_output, list):
                        pred_output = pred_output[0]

                    # print("==> Generated output:")
                    # viz.draw_grid_pair(grid_inp.cells, pred_output.cells)

                    if not np.array_equal(grid_inp.cells, pred_output.cells):
                        example_grid_set.append((grid_inp.cells, pred_output.cells))

                if len(example_grid_set) > 0:
                    task_invalid = False

            except KeyboardInterrupt:
                print("\nKeyboard interrupt detected. Stopping the program.")
                raise  # Re-raise the KeyboardInterrupt to stop the program
            except Exception as e:
                print(f"==> Task FAILED with an exception:")
                print(f"Error type: {type(e).__name__}")
                print(f"Error message: {str(e)}")
                print("Traceback:")
                import traceback
                traceback.print_exc()

        # The ground truth label seq must not include EOS, and has NUM_SPECIAL_TOKENS 3 instead of 4.
        ground_truth_lbl_seq = [token-1 for token in label_seq[:-1]]
        return example_grid_set, task_desc, ground_truth_lbl_seq
    